import { AuthentifcationService } from '../services/authentifcation.service';
import { Router } from '@angular/router';
import { Observable } from 'rxjs';

@Component({
  selector: 'app-admin-teplate',
  templateUrl: './admin-teplate.component.html',
  styleUrls: ['./admin-teplate.component.css']
})
export class AdminTeplateComponent implements OnInit {

  constructor(public authService : AuthentifcationService ,private router:Router){}




ngOnInit(): void {

}
handelogout(){
  this.authService.logout().subscribe( {
    next :()=>{
      this.router.navigateByUrl("/login");

    }
  })

}
}
